<?php

/**
 * Leetcode 649 implemented with SPL Queue
 *
 * This solution simplifies the senator validation, so now it does not cause Time Limit Exceeded
 */
class Solution {

    /**
     * @param String $senate
     * @return String
     */
    function predictPartyVictory($senate) {
        $count = 0;

        for ($i = 0; $i < strlen($senate); $i++) {
            if ($senate[$i] == 'R') {
                if ($count < 0) {
                    $senate .= 'D';
                }

                $count++;
            } else {
                if ($count > 0) {
                    $senate .= 'R';
                }

                $count--;
            }
        }

        if ($count < 0) return 'Dire';
        return 'Radiant';
    }
}

